import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class RemoteService {
  http: HttpClient;
  baseURL: string = localhost:8080

  constructor(http: HttpClient) {
    this.http = http;
  }

}
